import React, { Component } from 'react'
import "bootstrap/dist/css/bootstrap.min.css";
import axios from 'axios';
const url2 = "http://localhost:4000/register/";

export default class ViewUsers extends Component {
    state={
        register:[],
        errormessage:""
    };
    fetchMovies = () => {
        axios.get(url2)
        .then((res)=>{
            this.setState({
                register:res.data,
            });
        })
        .catch((err)=>{
            console.log("Error :",err);
        });
    };
    componentDidMount() {
        this.fetchMovies();
      }
  render() {
    const { register } = this.state;
    const rows = register.map((reg) => (
      <tr>
        <td>{reg.id}</td>
        <td>{reg.fname}</td>
        <td>{reg.email}</td>
        <td>{reg.district}</td>
        <td>{reg.mobile}</td>
        <td>{reg.uname}</td>
        <td>{reg.password}</td>
      </tr>
    ));
    return (
     <>
                <div className="container mb-3 mt-7">
                  <table className="table table-striped table-bordered mydatatable" style={{width:"100%"}} >
                    <thead>
                      <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Email ID</th>
                        <th>District</th>
                        <th>Mobile Number</th>
                        <th>Username</th>
                        <th>Password</th>
                      </tr>
                    </thead>
                    <tbody>{rows}</tbody>
                  </table>
                </div>
     
  
  
     </>
    )
  }
}
